// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;



contract Profile {

    struct Bio {
        string firstName;
        string lastName;

    }
    mapping (address => Bio) user;

    function addBio(address _user) public {
        user[_user] = Bio("Tim", "Tim");
    }
}

